import React from 'react';

const JefeView = () => {
  return (
    <div>
      <h1>Vista del Jefe</h1>
      <button onClick={() => console.log('Editar datos')}>Editar datos</button>
      <button onClick={() => console.log('Descargar reportes')}>Descargar reportes</button>
    </div>
  );
};

export default JefeView;
